refer --> refer to the implementation of  (assuming this is what you mean? I'm not sure)", 'comment_created': datetime.datetime(2022, 11, 21, 18, 35, 21, tzinfo=datetime.timezone.utc), 'commenter': 'seanlip', 'type': 'User'}, {'comment_id': 1028400860, 'comment_body': 'Ditto here and elsewhere).', 'comment_created': datetime.datetime(2022, 11, 21, 18, 35, 34, tzinfo=datetime.timezone.utc), 'commenter': 'seanlip', 'type': 'User'}, {'comment_id': 1028402165, 'comment_body': 'Just to check, can you explain why this changed? (Doing so in these github review comments is fine)', 'comment_created': datetime.datetime(2022, 11, 21, 18, 37, 12, tzinfo=datetime.timezone.utc), 'commenter': 'seanlip', 'type': 'User'}, {'comment_id': 1028406382, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 11, 21, 18, 42, 15, tzinfo=datetime.timezone.utc), 'commenter': 'soumyo123-prog', 'type': 'User'}, {'comment_id': 1028406438, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 11, 21, 18, 42, 20, tzinfo=datetime.timezone.utc), 'commenter': 'soumyo123-prog', 'type': 'User'}, {'comment_id': 1028407538, 'comment_body': 'It is because earlier, the initial values of currentPositionInStateVersionHistoryList and currentPositionInMetadataVersionHistoryList were null and their types were (number | null). After strongly typing those variables, I set the initial values of these variables to 0.', 'comment_created': datetime.datetime(2022, 11, 21, 18, 43, 47, tzinfo=datetime.timezone.utc), 'commenter': 'soumyo123-prog', 'type': 'User'}, {'comment_id': 1028415506, 'comment_body': 'Can you add comments explaining what these variables mean? I don't understand what they mean and that's making it hard for me to evaluate whether the use of 0 is sensible or not.

If 0 is the actually-correct value (it actually logically represents the current position) then this should be fine. But if you're using it as a "sentinel" value just to satisfy the typing (and it could be replaced by -1, say, without consequence), then that's not fine and we need to discuss this further.', 'comment_created': datetime.datetime(2022, 11, 21, 18, 53, 53, tzinfo=datetime.timezone.utc), 'commenter': 'seanlip', 'type': 'User'}, {'comment_id': 1028424545, 'comment_body': 'It represents the current position in the version history list of a particular state or metadata when the user is navigating through the list. Earlier, I was using null to represent when the service was not initialized. But later on, I changed it to zero to satisfy the typing.

But, I think null or -1 will be a conceptually good sentinel value because they can represent that the service has not been initialised yet. After the initialisation, it will be set to zero to represent the first element.', 'comment_created': datetime.datetime(2022, 11, 21, 19, 5, 12, tzinfo=datetime.timezone.utc), 'commenter': 'soumyo123-prog', 'type': 'User'}, {'comment_id': 1028435544, 'comment_body': 'Add (if true): "This is because the item that is shown to a user by default is the first item in each of these lists."', 'comment_created': datetime.datetime(2022, 11, 21, 19, 19, 22, tzinfo=datetime.timezone.utc), 'commenter': 'seanlip', 'type': 'User'}, {'comment_id': 1028436713, 'comment_body': 'Done.', 'comment_created': datetime.datetime(2022, 11, 21, 19, 20, 53, tzinfo=datetime.timezone.utc), 'commenter': 'soumyo123-prog', 'type': 'User'}]
